import React from 'react';
import PropTypes from 'prop-types';
import { useTheme } from '@mui/material/styles';
import Container from 'common/Container';
import Box from '@mui/material/Box';
import { dark } from 'theme/colors';
import {
  Contact,
  Hero,
  Main,
  Partners,
  Services,
  WhyUs,
  Process,
  Reviews,
} from './components';

const DesignAgency = ({ themeMode = 'light' }) => {
  const theme = useTheme();

  return (
    <Box>
      <Box
        sx={{
          background: `linear-gradient(180deg, ${theme.palette.alternate.main} 0%, ${theme.palette.background.paper} 100%);`,
          position: 'relative',
        }}
      >
        <Container position="relative" zIndex={2}>
          <Hero />
        </Container>
      </Box>
      <Container>
        <Partners />
      </Container>
      <Box bgcolor={theme.palette.alternate.main} position={'relative'}>
        <Container paddingX={'0 !important'} maxWidth={'100%'}>
          <Services themeMode={themeMode} />
        </Container>
      </Box>
      <Container paddingBottom={'0 !important'}>
        <WhyUs />
      </Container>
      <Box
        component={'svg'}
        preserveAspectRatio="none"
        xmlns="http://www.w3.org/2000/svg"
        x="0px"
        y="0px"
        viewBox="0 0 1921 273"
        sx={{
          marginBottom: theme.spacing(-1),
        }}
      >
        <polygon
          fill={theme.palette.alternate.main}
          points="0,273 1921,273 1921,0 "
        />
      </Box>
      <Box bgcolor={theme.palette.alternate.main} position={'relative'}>
        <Container position="relative" zIndex={2}>
          <Process themeMode={themeMode} />
        </Container>
        <Box
          component={'svg'}
          preserveAspectRatio="none"
          xmlns="http://www.w3.org/2000/svg"
          x="0px"
          y="0px"
          viewBox="0 0 1921 273"
          sx={{
            position: 'absolute',
            width: '100%',
            left: 0,
            bottom: 0,
            right: 0,
            zIndex: 1,
            height: '35%',
          }}
        >
          <polygon
            fill={theme.palette.background.paper}
            points="0,273 1921,273 1921,0 "
          />
        </Box>
      </Box>
      <Container>
        <Main />
      </Container>
      <Box bgcolor={theme.palette.alternate.main}>
        <Container>
          <Reviews />
        </Container>
      </Box>
      <Box bgcolor={dark.background.paper}>
        <Container>
          <Contact />
        </Container>
      </Box>
    </Box>
  );
};

DesignAgency.propTypes = {
  themeMode: PropTypes.string.isRequired,
};

export default DesignAgency;
